import React, { useState } from "react";
import './Styles/App.css'

function App() {
  const [counter, setCounter] = useState(0);
  function increment(){
    setCounter(counter+1)
  }
  return (
    <div className="App">
      {counter}
      <div className="block" onClick={() => setCounter(counter++)}>
      </div>
    </div>
  );
}

export default App;
